import React from 'react';
import { FirstName, LastName } from './App';
const ComC = () => {
  return (
    <>
      <FirstName.Consumer>
        {(value) => {
          return (
            <LastName.Consumer>
              {(lname) => {
                return (
                  <h1>
                    My Name is {value} {lname}
                  </h1>
                );
              }}
            </LastName.Consumer>
          );
        }}
      </FirstName.Consumer>
    </>
  );
};
export default ComC;

